import React from 'react';
import './Navbar.css'
import { Link } from 'react-router-dom';
import {logo} from '../../assets/[removal.ai]_7cf2a0ce-1cba-4451-a967-11489d40d09d-9k1.png'
  const Navbar = () => {
  return (
<div>
    <div className='nav'>
        <div className='nav-logo'><img className='logo' src={ logo} alt=''/>AgriSENSE</div>
      <ul className='nav-menu'>
        <Link to="/" className='nav-contact'>Home</Link>
        <Link to="/login" className='nav-contact'>Login</Link>
        <Link to="/sign up" className='nav-contact'>Register</Link>
        <Link to="/explore" className='nav-contact'>Explore</Link>
        <Link to="/about" className='nav-contact'>About</Link>
        <Link to="/contact" className='nav-contact'>Contact</Link>

      </ul>
      </div>
      </div>
  )
  }
export default Navbar;
